import "./CostItem.css";

function CostItem() {
  const Date = new Date();

  return (
    <div className="cost-item">
      <div>{JSON.stringify(Date)}</div>
      <div className="cost-item__description">
        <h2>Холодильник</h2>
        <div className="cost-item__price">1000.00</div>
      </div>
    </div>
  );
}
export default CostItem;
